window.bookSummaryJSON = "<p>Book two in the blockbuster Maze Runner series that spawned a movie franchise and ushered in a worldwide phenomenon! And don't miss <i>The Fever Code</i>, the highly-anticipated series conclusion that finally reveals the story of how the maze was built! </p> <p>Thomas was sure that escape from the Maze would mean freedom for him and the Gladers. But WICKED isn't done yet. Phase Two has just begun. The Scorch. <br> The Gladers have two weeks to cross through the Scorch—the most burned-out section of the world. And WICKED has made sure to adjust the variables and stack the odds against them. <br> There are others now. Their survival depends on the Gladers' destruction—and they're determined to survive. <br> Friendships will be tested. Loyalties will be broken. All bets are off. </p> <p><i>The Maze Runner</i> and <i>Maze Runner: The Scorch Trials</i> are now major motion pictures featuring the star of MTV's Teen Wolf, Dylan O'Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster. The third movie, <i>Maze Runner: The Death Cure</i>, will hit screens in 2018. </p> <p>Also look for James Dashner's edge-of-your-seat MORTALITY DOCTRINE series! </p> <p>Praise for the Maze Runner series: <br> A #1 <i>New York Times</i> Bestselling Series <br> A USA Today Bestseller <br> A Kirkus Reviews Best Teen Book of the Year <br> An ALA-YASLA Best Fiction for Young Adults Book<br> An ALA-YALSA Quick Pick </p> <p>\"[A] mysterious survival saga that passionate fans describe as a fusion of <i>Lord of the Flies</i>, <i>The Hunger Games</i>, and <i>Lost</i>.\" (<i>EW</i>) </p> <p>\"Wonderful action writing—fast-paced…but smart and well observed.\" (<i>Newsday)</i></p> <p>\"[A] nail-biting must-read.\" (<i>Seventeen</i>) </p> <p>\"Breathless, cinematic action.\" (<i>Publishers Weekly)</i></p> <p>\"Heart pounding to the very last moment.\" (<i>Kirkus Reviews)</i></p> <p>\"Exclamation-worthy.\" (<i>Romantic Times)</i></p> <p>\"James Dashner's illuminating prequel [<i>The Kill Order</i>] will thrill fans of this Maze Runner [series] and prove just as exciting for readers new to the series.\" (Shelf Awareness, Starred)</p> <p>\"Take a deep breath before you start any James Dashner book.\" (<i>Deseret News)</i></p>"; 
